import './App.css';
import Demo from './component/Input'

function App() {
  return (
    <div className="App">
      <div>
        <select>
            <Demo/>
            <option value="1">1</option>
            <option value="2">2</option>
        </select>
      </div>

    </div>
  );
}

export default App;
